import React from "react";
import './showAll.css';
import Header from "../Header/header";

function ShowAll(){
    return(
        <>
            <Header></Header>
            <div className="back">
                <div className="border">
                    <div className="pageTitle">전체 교환글</div>
                    <div className="writes">
                        <div>제목</div>
                        <div>상태</div>
                    </div>
                </div>
            </div>
        </>
    )
}
export default ShowAll
